-- ----------------------------
-- Table structure for `alarm`
-- ----------------------------
DROP TABLE IF EXISTS `alarm`;
CREATE TABLE `alarm` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '预警类型 1 监督检查预警',
  `alarm_time` datetime NOT NULL COMMENT '预警时间',
  `fix_time` datetime NOT NULL COMMENT '落实时限',
  `alarm_source` int(11) NOT NULL DEFAULT '0' COMMENT '预警来源',
  `fix_dept` varchar(255) NOT NULL DEFAULT '' COMMENT '落实部门',
  `alarm_title` varchar(255) NOT NULL DEFAULT '' COMMENT '预警主题',
  `alarm_content` varchar(255) NOT NULL DEFAULT '' COMMENT '预警内容',
  `fix_method` varchar(255) NOT NULL DEFAULT '' COMMENT '整改要求',
  `alarm_store` int(11) NOT NULL DEFAULT '2' COMMENT '预警存储 1 库外 2 库内',
  `alarm_resp` varchar(255) NOT NULL DEFAULT '' COMMENT '预警响应',
  `fix_status` int(11) NOT NULL DEFAULT '1' COMMENT '落实状态 1 未落实 2 已落实',
  `audit_status` int(11) NOT NULL DEFAULT '1' COMMENT '审核状态 1 未审核 2 审核通过 3 审核未通过',
  `resp_status` int(11) NOT NULL DEFAULT '1' COMMENT '响应状态 1 未响应 2 已响应',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '是否有效 1 有效 2 无效',
  `resp_time` int(11) NOT NULL COMMENT '响应时间',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1017 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of alarm
-- ----------------------------

