  `id` int(11) NOT NULL AUTO_INCREMENT,
  `risk_info_id` int(11) NOT NULL DEFAULT '0' COMMENT '风险信息id',
  `user_id` varchar(15) NOT NULL DEFAULT '0' COMMENT '责任人id',
  `dept_id` int(11) NOT NULL DEFAULT '0' COMMENT '责任人部门id',
  `risk_level_id` int(11) NOT NULL DEFAULT '0' COMMENT '风险等级id',
  `risk_score` int(11) NOT NULL DEFAULT '0' COMMENT '分数',
  `is_joint` int(11) NOT NULL DEFAULT '1' COMMENT '是都连带 1 是  2 不是',
  `joint_user_id` varchar(15) NOT NULL DEFAULT '0' COMMENT '受人连带者id',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '是否有效 1 有效 2 无效',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

