-- Table structure for `dictionary`
-- ----------------------------
DROP TABLE IF EXISTS `dictionary`;
CREATE TABLE `dictionary` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(11) NOT NULL COMMENT '字典类型 1 干部工人标识 2 劳动班制 3 工种 4 政治面貌 5 职位级别 6 职务名称 7 部门名称 8班组名称 9线路名称 10 列车类别 11 天气情况 12 风险等级  13 站场名称 14 活项归属 15 修程 16 机车类型 17 机车活项 18 预警来源 19 预警类型 20 风险概述-类别 21 风险概述-分类1 22 风险概述-分类2 23 风险概述-分类3  24 风险概述-条款 25 追踪类别',
  `name` varchar(255) NOT NULL COMMENT '字典名称',
  `user_key` varchar(50) NOT NULL DEFAULT '' COMMENT '用户定义key',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '状态 1 有效 2无效',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_type` (`type`)
) ENGINE=InnoDB AUTO_INCREMENT=4921 DEFAULT CHARSET=utf8;

