-- Table structure for `risk`
-- ----------------------------
DROP TABLE IF EXISTS `risk`;
CREATE TABLE `risk` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `report_user_id` varchar(15) NOT NULL COMMENT '提报人',
  `from_dept_id` int(11) NOT NULL COMMENT '来源部门',
  `event_date_time` datetime NOT NULL,
  `event_time_year` int(11) NOT NULL COMMENT '发生时间年',
  `event_time_month` int(11) NOT NULL COMMENT '发生时间月',
  `event_time_day` int(11) NOT NULL COMMENT '发生时间日',
  `event_time_hour` int(11) NOT NULL COMMENT '发生时间时',
  `event_time_min` int(11) NOT NULL COMMENT '发生时间分',
  `event_place_type` int(11) NOT NULL DEFAULT '1' COMMENT '事件地点类型 1 站点 2 区间',
  `event_place_line` int(11) NOT NULL DEFAULT '0' COMMENT '事件发生路线',
  `event_place_station` int(11) DEFAULT '0' COMMENT '事件发生站',
  `event_place_start` int(11) DEFAULT '0' COMMENT '事件发生起点',
  `event_place_end` int(11) DEFAULT '0' COMMENT '事件发生终点',
  `train_type` int(11) DEFAULT '0' COMMENT '列车类别',
  `weather_type` varchar(255) DEFAULT '' COMMENT '天气情况',
  `resp_user_id` varchar(15) DEFAULT '' COMMENT '责任人',
  `resp_dept_id` int(11) DEFAULT '0' COMMENT '责任部门',
  `risk_type` int(11) DEFAULT '0' COMMENT '风险类别',
  `risk_level` int(11) DEFAULT '0' COMMENT '风险概述',
  `risk_outline_id` int(11) DEFAULT '0' COMMENT '风险概述描述',
  `risk_detail` text COMMENT '风险详述',
  `risk_store` int(11) NOT NULL DEFAULT '2' COMMENT '风险存储 1 库外 2 库内',
  `menu_cat` int(11) NOT NULL DEFAULT '1' COMMENT '子菜单分类',
  `menu_type` int(11) NOT NULL DEFAULT '1' COMMENT '子菜单选项',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '1 有效 2 无效',
  `audit_status` int(11) NOT NULL DEFAULT '1' COMMENT '审核状态 1 待审 2 审核通过 3 审核拒绝',
  `audit_time` int(11) NOT NULL COMMENT '审核通过时间',
  `room_sign` int(11) NOT NULL DEFAULT '2' COMMENT '是否需要车间/科室签认 1 是  2 否',
  `leader_sign` int(11) NOT NULL DEFAULT '2' COMMENT '是否需要分管领导签认 1 是  2 否',
  `need_fix_text` int(11) NOT NULL DEFAULT '2' COMMENT '是否需要填写处置落实情况 1 是  2 否',
  `is_stress` int(11) NOT NULL DEFAULT '2' COMMENT '是否进入日分析重点甄选队列 1 是  2 否',
  `stress_trace` int(11) NOT NULL DEFAULT '1' COMMENT '是否重点追踪 1 是 2 否',
  `deal_status` int(11) NOT NULL DEFAULT '1' COMMENT '是否处置 1 未处置 2 已处置',
  `fix_user_id` varchar(15) NOT NULL DEFAULT '' COMMENT '问题原因',
  `risk_reason` varchar(255) NOT NULL DEFAULT '' COMMENT '问题原因',
  `risk_fix` varchar(255) NOT NULL DEFAULT '' COMMENT '落实情况',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8;

