INSERT INTO `dictionary` VALUES ('699', '24', '1.不执行“运输调度集中统一指挥、行车单一指挥”。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('700', '24', '2.制定违背行车基本规章的“土规定”。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('701', '24', '3.隐瞒事故。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('702', '24', '4.饮酒上岗、值班离岗。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('703', '24', '1.冒进、冒出信号或超速运行。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('704', '24', '2.擅自关闭行车安全装备或错误输入相关参数。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('705', '24', '3.非正常停车后不按规定报告车站值班员或列车调度员。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('706', '24', '4.班前、班中饮酒或当班睡觉、擅自离岗。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('707', '24', '5.无证驾驶或擅自交他人驾驶。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('708', '24', '6.作业人身安全防护不到位。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('709', '24', '1.不按规定对停留机车、车辆采取防溜措施，危及客车安全。动车组无动力停留时未施加停放制动；无停放制动功能或停放功能不能满足停放需求时，未使用止轮器牢靠固定。运用客车（出库待发、到达待入库、站内立折、国际联运客车更换转向架作业完毕后）停放保留时，未使用止轮木（或铁鞋）防溜。有固定看护人员场所停放备用客车未使用铁鞋防溜。站场内停留、保留的客车未使用客车“三防”铁鞋防溜和执行“双向双防溜”。客车底违规在中间站停留（始发终到的客车底除外）。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('710', '24', '2.工程线在没有隔开设备的情况下与既有线接轨。隔开设备无法保证车列倾覆后不影响既有线客车进路安全时，未在距隔开设备500m以外的工程线上适当地点设置脱轨器。施工宿营车及自轮运转特种设备，在京包线集大间、张集线、集包线、包兰线包惠间、包西线停留时，未停放在固定车站及股道（见附件），未使用防溜枕木和铁鞋进行防溜，未派人24小时看守。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('711', '24', '3.擅自关闭、人为破坏行车安全装备，违章解锁监控装置或擅自隔离列控车载设备。高铁未按规定设置限速放行动车组列车；旅客列车临时限速，不确认相关旅客列车司机收知限速命令。漏装、错装LKJ控车数据，漏写、错写LKJ临时数据，列控系统控制速度数据设置错误。LKJ和应答器的基础数据变更后，第一趟违规放行旅客列车，未发布调度命令放行第一趟列车，无LKJ、应答器基础数据的专管人员及机务有关人员添乘机车开行首趟列车。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('712', '24', '4.穿越正线调车作业未纳入不影响旅客列车进路的调车固定“天窗”；无值班管理人员（中间站为站长或副站长、站长助理）在现场盯控的情况下，进行穿越正线调车作业。在有分路不良的道岔区段及分路不良区段防护道岔的旅客列车进路上办理转换该道岔的第二条列车进路或调车进路。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('713', '24', '5.未经调度所主任或副主任审核签认，发布、交递、传达涉及变更旅客列车运行速度的调度命令；未按规定正确及时发布、交递、传达限速运行调度命令。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('714', '24', '6.餐车油垢、排气扇油垢、车顶烟囱周边未定期清理，存在严重火灾隐患。列车长（安全员）、检车乘务长（检车乘务员、随车机械师）、乘警长（乘警）连续两小时未巡视整列客车火灾隐患。列车运行中违规油炸食品。客车运行中发生电气装置打火、冒烟等异常现象，未立即进行处置。乘务、看车、保洁等作业人员未在车内指定位置吸烟，使用明火。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('715', '24', '7.办理客运业务的车站接旅客列车时，动车组列车未接入固定股道、固定站台，动车组以外的旅客列车未接入有站台的固定线路。未经列车调度员准许（动车组列车未经调度所值班主任或副主任准许）、未发布调度命令、未预告司机，擅自变更固定接发旅客列车线路；旅客列车接近时，变更接车进路。中间站变更接发旅客列车进路后，继续办理后续列车或相对方向列车的通过进路。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('716', '24', '8.客车未停稳开车门、车动后漏锁车门。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('717', '24', '9.动车组、客车机车车辆走行部等关键部件漏检、漏修、漏探，存在严重安全隐患；将走行部、制动系统存在故障的机车车辆编入旅客列车。存在严重故障的动车组、客车机车车辆上线使用。客车径路钢轨、道岔尖轨（含心轨）、基本轨、翼轨、辙叉达到更换标准未及时进行处置。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('718', '24', '10.旅客列车机车、车辆（含临时加挂车辆）未安设车钩防提、防跳、折角塞门防关装置（或功能），出库前未进行双人检查确认。旅客列车临时加挂车辆，有客列检作业时，检查确认车钩防提、防跳、折角塞门防关装置状态少于两人；无客列检作业时，车辆乘务员未进行安设、确认。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('719', '24', '11.无联锁试验培训合格证或超越证书等级资格进行联锁试验；未按规定审批变更联锁关系、修改电路图及联锁软件。联锁试验不彻底或违章作业造成联锁错误；违章使用封连线；违章拆、改配线，造成联锁关系错误。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('720', '24', '12.作业人员在天窗点外违规进入高铁线路防护栅栏内，或在高铁线路防护栅栏内遗留作业机具、材料；作业人员出入防护栅栏后未锁闭通道门。旅客列车运行中司机发现人员、异物侵限时，未及时采取停车措施，并未向列车调度员（车站值班员）报告。旅客列车通过道口时无人看守；有人看守道口，作业人员未按规定落杆（关闭栏门）或未及时采取有效防护措施，危及客车运行安全。通过旅客列车的站内平过道，未安设防护栅栏或日常不锁闭、不关闭，使用时没有专人监护。通行客运汽车的铁路道口，列车或机车车辆通过未派人看守监护。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('721', '24', '13.未对货物易旋转、活动部位、垂落或开放部位锁闭或捆绑（包括加固不良），存在刮碰客车隐患的。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('722', '24', '14.违章进行施工、检修、故障处理，天窗点外违规上道或违规使用机具上道作业，危及客车安全。通过客车或邻近通过客车线路施工封锁前违章上道，设备管理单位未派人监护，或监护人员未到场自行开工。没有3年以上现场工作经历、不熟悉管内设备及列车运行情况、不熟知安全防护知识、未接受过防护专业培训、考试不合格的人员，担任高铁和客车线路的工务、电务、供电施工防护人员、驻站联络员。客车径路与施工、维修现场间未按规定设置防侵限的隔离措施；自轮运转设备和大型施工机械上道作业前未做好旋转设备的防旋转侵限硬性防护措施。客车径路上的轨', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('723', '24', '15.在邻近客车进路的接触网支柱附近施工作业，对接触网支柱没有采取堆设土档或装设隔离桩等硬性防护措施进行保护，以及设备管理单位未派人监督；在未做好硬性防护措施或设备管理单位监护人员没到现场的情况下进行施工作业。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('724', '24', '16.高铁发生列车占用丢失、线路设备故障、接触网倒杆塌网、异物侵限报警等问题，未按规定处理放行动车组列车。车辆乘务员、随车机械师在应急处置中不按规定办理，盲目带车。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('725', '24', '17.未经批准进行CTC、列控系统软件修改、升级，动车组车载设备未测试、检修合格，盲目放行动车组上线运行。不具备放行列车条件冒险放行客车；客车弹簧压死冒险运行；旅客列车未确认旅客上下、行包装卸、上水完毕发车。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('726', '24', '18.发生客车安全信息，相关人员没有在第一时间按程序汇报，或过滤、截留、漏报、瞒报和迟报。得到客车信息后，未妥善分析处理，未制定安全控制措施消除安全隐患。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('727', '24', '1.点外违章上道、作业。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('728', '24', '2.雇用劳务人员上道作业无正式员工带领。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('729', '24', '3.擅自违规破拆防护栅栏。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('730', '24', '4.施工机车、车辆、自轮运转设备在站内停留时，应采取防溜措施而未采取。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('731', '24', '5.施工、维修作业人员及机具、路料侵限。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('732', '24', '6.线路两侧预卸或更换下来的长轨条应采取“防涨、防跑（窜）”措施而未采取。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('733', '24', '7.进入安全限界以内的装载机、挖掘机等大型机械作业未进行“一机一人”防护。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('734', '24', '8.施工、维修作业不设防护。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('735', '24', '9.防护人员漏传错传行车信息。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('736', '24', '10.缩小限速范围、错误提高限速值或错误升级显示减速信号。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('737', '24', '11.漏发、错发、漏传、错传施工调度命令。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('738', '24', '12.设备管理单位发现无协议施工未及时制止。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('739', '24', '13.随意改变施工类别、降低施工等级。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('740', '24', '14.跨越架不按设计方案搭设或设计方案存在明显错误、漏洞。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('741', '24', '15.违规使用单轨车、小车、轻型车辆。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('742', '24', '16.电气化区段作业时须安设连接线、接地线而未安设或错误安设。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('743', '24', '17.未经检验或检验不合格的架桥机、吊车在营业线进行施工作业。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('744', '24', '18.自轮运转设备未按规定载入运行揭示，或擅自关闭三项设备，解除GYK控制。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('745', '24', '19.在施工联签单未全部签认的情况下，在施工“运统—46”登记签认、盲目申请开通调令。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('746', '24', '1.需要接触网停电的作业，在未停电的情况下盲目开始作业或误登带电杆塔及电力设备。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('747', '24', '2.接触网带电时，利用非专用工具测量接触网与房屋、建筑、设备距离。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('748', '24', '3.未具备送电条件盲目送电。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('749', '24', '4.作业中使用耐压检验不合格的绝缘用具。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('750', '24', '5.电器设备未切断电源（通信、信号设备除外）、带压部件未切断压力源或带压作业。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('751', '24', '6.机车车辆运行中进入钩档摘接软管或调整钩位等作业。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('752', '24', '7.吊起物件上有人或使用开焊裂损的吊具、吊耳。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('753', '24', '8.砂轮机使用超限或裂损的砂轮。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('754', '24', '9.下井坑作业，未进行井坑内有害气体检测或无人监护。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('755', '24', '10.使用检验不合格或达到国家法定强制报废标准的机动车辆。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('756', '24', '11.未进行明火试验焊修油气罐。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('757', '24', '12.常压锅炉按承压使用；承压锅炉超压运转；锅炉（茶炉）缺水干烧。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('758', '24', '13.电梯未经检验或检验不合格、自动扶梯急停开关及保护装置失效继续使用。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('759', '24', '1.不执行“运输调度集中统一指挥、行车单一指挥”。列车调度员向行车管理人员了解情况时，不如实汇报，延误列车运行或扩大事故损失。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('760', '24', '2.制定违背行车基本规章的“土规定”。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('761', '24', '3.接到发生铁路交通事故的报告后，未按照规定逐级进行报告或故意隐瞒事故真相，给事故的分析、调查带来困难。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('762', '24', '4.饮酒上岗、值班离岗。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('763', '24', '1.班前、班中饮酒或机车乘务员（包括地勤司机）值乘中睡觉、擅自离岗。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('764', '24', '2.未按规定正确及时发布、交递、传达限速运行调度命令。（动车、客车考核执行《呼和浩特铁路局客车和高铁安全红线“18条”》）', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('765', '24', '3.错误输入通用/万吨模式、本/补模式或违章解锁造成LKJ不控。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('766', '24', '4.遇有开行路用列车、牵引编有非提速货车等未按规定设置车速等级超速运行。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('767', '24', '5.货运机车乘务员或调小机车乘务员擅自关闭、人为破坏行车安全装备，违章解锁监控装置。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('768', '24', '6.列车机车与车辆连挂时未试拉、值乘机班未确认车钩连挂及锁闭状态。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('769', '24', '7.机车乘务员在列车运行和调车作业中玩手机。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('770', '24', '8.动车后未关闭或开启机车两侧车门。', '', '1', '1461395482', '1461395482');
INSERT INTO `dictionary` VALUES ('771', '24', '9.列车或单机停留时，无人看守且未采取任何防溜措施或未解除防溜动车且未造成后果的。', '', '1', '1461395482', '1461395482');
